import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import './App.css';
function App() {
  return (
    <div className="App">
      <h5>React CRUD operations using PHP API and MySQL</h5>

      <BrowserRouter>
        <nav>
          <ul>
            <li>
              <Link to="/">List Users</Link>
            </li>
            <li>
              <Link to="final-project/addService.php">Create User</Link>
            </li>
          </ul>
        </nav>
        <Routes>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
